import React from "react";
import { Carousel } from "react-responsive-carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";

const Experience = () => {
  return (
    <>
      <Carousel>
        <div>
          <div className="carousel-content">Carousel 1</div>
        </div>
        <div>
          <div className="carousel-content">Carousel 2</div>
        </div>
        <div>
          <div className="carousel-content">3</div>
        </div>
      </Carousel>
    </>
  );
};

export default Experience;
